// DOM Elements
const loginView = document.getElementById('login-view');
const resultsView = document.getElementById('results-view');
const loginForm = document.getElementById('login-form');
const examNumberInput = document.getElementById('exam-number');
const errorMessage = document.getElementById('error-message');
const loadingSpinner = document.getElementById('loading-spinner');

const studentNameEl = document.getElementById('student-name');
const finalResultEl = document.getElementById('final-result');
const collegeNameEl = document.getElementById('college-name');
const universityNameEl = document.getElementById('university-name');

// Event Listener
loginForm.addEventListener('submit', function(event) {
    event.preventDefault(); // Prevent form from reloading the page
    
    const examNumber = examNumberInput.value.trim();
    errorMessage.style.display = 'none'; // Hide previous errors

    if (!examNumber) {
        showError('الرجاء إدخال الرقم الإمتحاني.');
        return;
    }

    // Show loading spinner
    loadingSpinner.style.display = 'block';

    // Simulate network delay
    setTimeout(() => {
        const student = students.find(s => s.id === examNumber);

        if (student) {
            // Populate results page
            studentNameEl.textContent = student.name;
            collegeNameEl.textContent = student.result;
            universityNameEl.textContent = student.university;
            
            // Special handling for rejected students
            if (student.result === 'جميع الرغبات مرفوضة') {
                finalResultEl.innerHTML = `<span style="color: var(--danger-red);">${student.result}</span>`;
            } else {
                 finalResultEl.innerHTML = `نتيجتك هي <span>${student.result}</span> في جامعة <span>${student.university}</span>`;
            }

            // Switch views
            loginView.style.display = 'none';
            resultsView.style.display = 'block';
            window.scrollTo(0, 0); // Scroll to top

        } else {
            showError('الرقم الإمتحاني غير صحيح، يرجى التحقق منه.');
        }
        
        // Hide loading spinner
        loadingSpinner.style.display = 'none';

    }, 2000); // 2-second delay
});

function showError(message) {
    errorMessage.textContent = message;
    errorMessage.style.display = 'block';
}